import React from 'react';
import ReactDOM from "react-dom";
import { library } from "@fortawesome/fontawesome-svg-core";
import { fas } from "@fortawesome/free-solid-svg-icons";
import { faTwitter, faFontAwesome } from "@fortawesome/free-brands-svg-icons";
import { faHatCowboy } from "@fortawesome/pro-thin-svg-icons";
import { faHatChef } from "@fortawesome/sharp-solid-svg-icons";
import { faPlateUtensils } from "@fortawesome/sharp-regular-svg-icons";

library.add(
  fas,
  faTwitter,
  faFontAwesome,
  faHatCowboy,
  faHatChef,
  faPlateUtensils
);


export default function History(props) {

    return (
      <div className="history-section">
        {(props.history).map((oprt, index) => {
          return (
            <div className="history-div" key={index}>
              <div className="history-result">{oprt.re}</div>
              <div className="history-operation">{oprt.op}</div>
            </div>
          );
        })}
        <button>

        </button>
      </div>
    );
}
